import React from 'react';

const About = () => {
  return (
    <section id="about" className="fade-in-section">
      <h2>About Me</h2>
      <p>
        Hi, I’m Venkata Sri Saketh Perapragada, a Computer Science and Engineering graduate (2024) from Rajamahendri Institute of Technology. I’m passionate about building smart and meaningful software solutions using Python, C++, and modern web technologies. With a strong foundation in CS fundamentals and hands-on project experience, I thrive in collaborative environments where creativity meets problem-solving. I'm actively seeking opportunities to grow as a software developer and contribute to impactful tech projects.
      </p>
    </section>
  );
};

export default About;
